import React, { Component } from 'react';
import './SearchBar.css';
import { Button } from "../Button";

class SearchBar extends Component {
    render() {
        return (
            <form className="search-form">
                <input type="text"/>
                <Button>Search</Button>"
            </form>
        );
    }
}
export default SearchBar;
